	//Extremely fast popcount: each byte that has a popcount smaller than 4 
	static inline __m256i popcount8x32_SmallerThan4(__m256i x) {
		const __m256i nibble_popcnt = _mm256_setr_epi8(
			0, 1, 1, 2, 1, 2, 2, 3,
			1, 2, 2, 3, 2, 3, 3, 4,
			0, 1, 1, 2, 1, 2, 2, 3,
			1, 2, 2, 3, 2, 3, 3, 4);

		const __m256i nibble_mask = _mm256_set1_epi8(0x0F);

		//_mm256_srli_si256()
		return _mm256_cmpgt_epi8(_mm256_set1_epi8(4),	//Compare sum with 4
			_mm256_add_epi8(
				_mm256_shuffle_epi8(nibble_popcnt, _mm256_and_si256(_mm256_srli_epi16(x, 4), nibble_mask)),   //Higher Nibble popcnt
				_mm256_shuffle_epi8(nibble_popcnt, _mm256_and_si256(x, nibble_mask)))); //Lower Nibble (x & 0x0F) popcnt


	}
#endif

