	constexpr uint64_t Size = sizeof(Chess_Lookup::BNNInternal::Weights_Rook) + sizeof(Chess_Lookup::BNNInternal::Weights_Bishop);

	template<uint64_t bb>
	static constexpr uint64_t mask_shift(int ranks) {
		return ranks > 0 ? bb >> (ranks << 3) : bb << -(ranks << 3);
	}

	template<int dir>
	static constexpr uint64_t dirMask(int square) {
		const int rank = square >> 3;
		const int file = square & 7;

		if constexpr (dir == 0)
			return 0xFFull << (square & 56); //HORIZONTAL
		else if constexpr (dir == 1)
			return 0x0101010101010101ull << (square & 7); //VERTICAL
		else if constexpr (dir == 2)
			return mask_shift<0x8040201008040201ull>(file - rank); //Diagonal
		else {
			return mask_shift<0x0102040810204080ull>(7 - file - rank); //Antidiagonal
		}
	}

	static uint64_t Serial(int sq, uint64_t occ, uint64_t mask, const uint64_t(&Weights)[64 * 14][8]) {

		uint64_t input = occ & mask;

		uint64_t result = 0;
		for (int bit = 0; bit < 14; bit++) {
			const uint64_t* weights = Weights[sq * 14 + bit];
			static thread_local uint64_t results[8];
			for (int i = 0; i < 8; i++) {
				results[i] = input ^ weights[i];
			}

			//This is the actual network code. 64 bit input. 64 bit first layer. 1 bit output
			uint8_t* vals = (uint8_t*)results;
			uint64_t target = 0;
			for (int i = 0; i < 64; i++)
			{
				target |= static_cast<uint64_t>((std::popcount(vals[i]) < 4)) << i; //64bit first layer
			}
			result |= static_cast<uint64_t>((std::popcount(target) > 16)) << bit;   //single bit output layer
		}
		return _pdep_u64(result, mask);
	}

#ifdef __AVX2__
	static uint64_t Vector(int sq, uint64_t occ, uint64_t mask, const uint64_t(&Weights)[64 * 14][8]) {
		const __m256i input = _mm256_set1_epi64x(occ & mask);
		uint64_t result = 0;
		for (int i = 0; i < 14; i++) {
			uint64_t R1 = (uint32_t)_mm256_movemask_epi8(Chess_Lookup::BNNInternal::popcount8x32_SmallerThan4(_mm256_xor_si256(input, _mm256_load_si256(reinterpret_cast<const __m256i*>(Weights[sq * 14 + i] + 0)))));
			uint64_t R2 = (uint32_t)_mm256_movemask_epi8(Chess_Lookup::BNNInternal::popcount8x32_SmallerThan4(_mm256_xor_si256(input, _mm256_load_si256(reinterpret_cast<const __m256i*>(Weights[sq * 14 + i] + 4)))));

			//64bit first layer reduction into single bit output
			result |= static_cast<uint64_t>((std::popcount(R1 | (R2 << 32))) > 16) << i;
		}
		return _pdep_u64(result, mask);
	}
#endif

	static uint64_t Rook(int sq, uint64_t occ) {
		const uint64_t mask = (dirMask<0>(sq) | dirMask<1>(sq)) ^ (1ull << sq);

#ifdef __AVX2__ 
		return Vector(sq, occ, mask, Chess_Lookup::BNNInternal::Weights_Rook);
#else 
		return Serial(sq, occ, mask, Chess_Lookup::BNNInternal::Weights_Rook);
#endif
	}


	static uint64_t Bishop(int sq, uint64_t occ) {
		const uint64_t mask = (dirMask<2>(sq) | dirMask<3>(sq)) ^ (1ull << sq);

#ifdef __AVX2__ 
		return Vector(sq, occ, mask, Chess_Lookup::BNNInternal::Weights_Bishop);
#else 
		return Serial(sq, occ, mask, Chess_Lookup::BNNInternal::Weights_Bishop);
#endif
	}

	static uint64_t Queen(int sq, uint64_t occ) {
		return Rook(sq, occ) | Bishop(sq, occ);
	}
	
